  INSERT INTO `book` VALUES 
    (7,'Advanced Techniques in JavaScript','Yasemin', 'JavaScript is a lightweight interpreted programming language. The web browser receives the JavaScript code in its original text form and runs the script from that. From a technical standpoint, most modern JavaScript interpreters actually use a technique called just-in-time compiling to improve performance; the JavaScript source code gets compiled into a faster, binary format while the script is being used, so that it can be run as quickly as possible.This book is much helpful!.', 20, 20,'FE', 'data:image/png;base64,'),
	(8,'Introduction to Spring Boot','Fatma','Spring Boot in Practice is a cookbook-style guide to Spring application development.Spring Boot and Spring Cloud simplify your microservice applications by providing common features and allowing you to focus on business logic by abstracting away details required for cloud-based development. Following a convenient Problem-Solution-Discussion format, it takes you technique-by-technique through Spring Boot fundamentals. You’ll dive deep into auto-configuration, security, microservices, and more.', 10, 10, 'BE', 'data:image/png;base64,'),
	(9,'React js for begineers','Andrea ','This book is designed for beginners who have some knowledge of HTML, CSS, and JavaScript. It covers the basics of React, including components, JSX, and state management. The book also includes an introduction to Redux and covers how to build a complete web application using React and Redux.', 15, 15, 'FE', 'data:image/png;base64,'),
